import goku from './images/goku.png'
import vegeta from './images/vegeta.png'
import gohanssj2 from './images/gohanssj2.webp'
import "./App.css"


function App() {
  return (
    <div>
      <img className="" src={goku} alt="goku" />
      <img src={vegeta} alt="vegeta" />
      <img src={gohanssj2} alt="gohanssj2" />

    </div>
  );
}

export default App;
